// Initialiser la pagination (cursor GraphQL) et la boucle produits
const staticData = $getWorkflowStaticData('global');
staticData.batchNumber = 0;
staticData.totalProcessed = 0;
staticData.totalSuccess = 0;
staticData.totalSkipped = 0;
staticData.totalFailed = 0;
staticData.failedProductIds = [];
staticData.cursor = null;
staticData.hasNextPage = true;
staticData.currentBatchSize = 0;
// Boucle produits manuelle (remplace SplitInBatches)
staticData.products = [];
staticData.currentProductIndex = 0;
staticData.currentProduct = null;
staticData.currentParserOutput = null;

return [{
  json: {
    cursor: null,
    batchNumber: 0,
    message: 'Pagination initialized. Manual product loop (no SplitInBatches).'
  }
}];

// Filtrer les produits GraphQL et stocker dans staticData pour boucle manuelle
const items = $input.all();
const response = items[0].json;
const staticData = $getWorkflowStaticData('global');

const productsData = response.data && response.data.products;
if (!productsData) {
  staticData.hasNextPage = false;
  staticData.currentBatchSize = 0;
  staticData.products = [];
  staticData.currentProductIndex = 0;
  return [{
    json: {
      _empty: true,
      filteredCount: 0,
      skippedCount: 0,
      batchSize: 0,
      error: 'Pas de donnees produits: ' + JSON.stringify(response.errors || 'unknown')
    }
  }];
}

const edges = productsData.edges || [];
const allProducts = edges.map(e => e.node);

// Sauvegarder pagination
staticData.hasNextPage = productsData.pageInfo ? productsData.pageInfo.hasNextPage : false;
staticData.cursor = productsData.pageInfo ? productsData.pageInfo.endCursor : null;
staticData.currentBatchSize = allProducts.length;
staticData.totalProcessed = (staticData.totalProcessed || 0) + allProducts.length;
staticData.batchNumber = (staticData.batchNumber || 0) + 1;

let skipped = 0;
let skippedOccasions = 0;

const filtered = allProducts.filter(p => {
  if (!p.title || p.title.trim() === '') { skipped++; return false; }
  if (!p.productType || p.productType.trim() === '') { skipped++; return false; }
  if (p.status !== 'ACTIVE') { skipped++; return false; }
  if (p.metafield && p.metafield.value) {
    const val = p.metafield.value.trim();
    if (val !== '' && val !== '[]') {
      try {
        const parsed = JSON.parse(val);
        if (Array.isArray(parsed) && parsed.length > 0) {
          skippedOccasions++;
          return false;
        }
      } catch(e) {
        skippedOccasions++;
        return false;
      }
    }
  }
  return true;
});

staticData.totalSkipped = (staticData.totalSkipped || 0) + skipped + skippedOccasions;

// Stocker produits filtres dans staticData (boucle manuelle)
staticData.products = filtered.map(p => {
  const numericId = p.id.replace('gid://shopify/Product/', '');
  return {
    productId: numericId,
    title: p.title,
    productType: p.productType,
    vendor: p.vendor || 'Non specifie'
  };
});
staticData.currentProductIndex = 0;

return [{
  json: {
    _empty: filtered.length === 0,
    filteredCount: filtered.length,
    skippedCount: skipped,
    skippedWithOccasions: skippedOccasions,
    batchSize: allProducts.length
  }
}];

// Lire le produit courant depuis staticData (boucle manuelle)
const staticData = $getWorkflowStaticData('global');
const index = staticData.currentProductIndex;
const product = staticData.products[index];

// Stocker pour reference dans les nodes suivants
staticData.currentProduct = product;

return [{
  json: {
    productId: product.productId,
    title: product.title,
    productType: product.productType,
    vendor: product.vendor,
    productIndex: index + 1,
    totalProducts: staticData.products.length
  }
}];

// Rate limit ChatGPT: 10 req/60s = 1 req/6s
// Code node (pas Wait node) pour ne pas casser le contexte
const items = $input.all();
await new Promise(resolve => setTimeout(resolve, 35000));
return items;

// Parser la reponse IA - lit le produit depuis staticData (pas de $('NodeName'))
const items = $input.all();
const chatResponse = items[0].json;
const staticData = $getWorkflowStaticData('global');
const originalProduct = staticData.currentProduct;

const VALID_OCCASIONS = [
  'Mariage', 'Soiree', 'Cadeau Femme', 'Cadeau Homme', 'Cadeau ado',
  'Saint-Valentin', 'Noel', 'Travail', 'Etudes', 'Voyages',
  'Business Trip', 'Quotidien', 'Sortie entre amis'
];
const FALLBACK = ['Quotidien', 'Sortie entre amis'];

let occasions = FALLBACK;
let parseError = null;
let usedFallback = false;

try {
  if (chatResponse.error) {
    throw new Error('API error: ' + JSON.stringify(chatResponse.error));
  }
  let content = chatResponse.choices[0].message.content.trim();
  content = content.replace(/```json\s*/g, '').replace(/```\s*/g, '').trim();
  const parsed = JSON.parse(content);
  if (Array.isArray(parsed)) {
    const valid = parsed.filter(o => VALID_OCCASIONS.includes(o));
    if (valid.length >= 2) {
      occasions = valid.slice(0, 2);
    } else if (valid.length === 1) {
      const fallbackOption = FALLBACK.find(f => f !== valid[0]) || FALLBACK[1];
      occasions = [valid[0], fallbackOption];
      usedFallback = true;
    } else {
      usedFallback = true;
    }
  } else {
    usedFallback = true;
  }
} catch(e) {
  parseError = e.message;
  usedFallback = true;
}

const productId = originalProduct.productId;
const occasionsJson = JSON.stringify(occasions);

// Stocker pour Log node (pas de reference cross-node)
staticData.currentParserOutput = {
  productId: productId,
  title: originalProduct.title,
  occasions: occasions,
  occasionsJson: occasionsJson,
  parseError: parseError,
  usedFallback: usedFallback
};

return [{
  json: {
    productId: productId,
    title: originalProduct.title,
    occasions: occasions,
    occasionsJson: occasionsJson,
    parseError: parseError,
    usedFallback: usedFallback
  }
}];

// Log resultat + incrementer l'index produit (boucle manuelle)
const staticData = $getWorkflowStaticData('global');
const items = $input.all();
const shopifyResponse = items[0].json;
const parserData = staticData.currentParserOutput;

let success = true;
let errorMsg = null;

try {
  if (shopifyResponse.error) {
    success = false;
    errorMsg = typeof shopifyResponse.error === 'string'
      ? shopifyResponse.error
      : JSON.stringify(shopifyResponse.error);
  } else if (shopifyResponse.errors) {
    success = false;
    errorMsg = typeof shopifyResponse.errors === 'string'
      ? shopifyResponse.errors
      : JSON.stringify(shopifyResponse.errors);
  } else if (shopifyResponse.metafield && shopifyResponse.metafield.id) {
    success = true;
  }
} catch(e) {
  success = false;
  errorMsg = 'Erreur verification: ' + e.message;
}

if (success) {
  staticData.totalSuccess = (staticData.totalSuccess || 0) + 1;
} else {
  staticData.totalFailed = (staticData.totalFailed || 0) + 1;
  staticData.failedProductIds = staticData.failedProductIds || [];
  staticData.failedProductIds.push({
    productId: parserData.productId,
    title: parserData.title,
    error: errorMsg,
    occasions: parserData.occasions
  });
}

// INCREMENTER L'INDEX (cle de la boucle manuelle)
staticData.currentProductIndex++;
const hasMoreProducts = staticData.currentProductIndex < staticData.products.length;

return [{
  json: {
    productId: parserData.productId,
    title: parserData.title,
    occasions: parserData.occasions,
    success: success,
    error: errorMsg,
    usedFallback: parserData.usedFallback || false,
    hasMoreProducts: hasMoreProducts,
    productIndex: staticData.currentProductIndex,
    totalProducts: staticData.products.length,
    runningTotal: {
      success: staticData.totalSuccess || 0,
      failed: staticData.totalFailed || 0,
      skipped: staticData.totalSkipped || 0
    }
  }
}];

// MAJ Etat Pagination - curseur GraphQL
const staticData = $getWorkflowStaticData('global');

const hasNextPage = staticData.hasNextPage || false;
const cursor = staticData.cursor || null;
const batchNumber = staticData.batchNumber || 0;
const currentBatchSize = staticData.currentBatchSize || 0;

return [{
  json: {
    cursor: cursor,
    batchNumber: batchNumber,
    currentBatchSize: currentBatchSize,
    shouldContinue: hasNextPage,
    totalProcessed: staticData.totalProcessed || 0,
    totalSuccess: staticData.totalSuccess || 0,
    totalSkipped: staticData.totalSkipped || 0,
    totalFailed: staticData.totalFailed || 0
  }
}];

// Pause 1 seconde entre les pages (Code node, pas Wait node)
const items = $input.all();
await new Promise(resolve => setTimeout(resolve, 1000));
return items;

// Preparer le curseur pour la prochaine page GraphQL
const staticData = $getWorkflowStaticData('global');

return [{
  json: {
    cursor: staticData.cursor || null,
    batchNumber: staticData.batchNumber || 0,
    message: 'Fetching next page of products...'
  }
}];

// Resume Final
const staticData = $getWorkflowStaticData('global');

const totalProcessed = staticData.totalProcessed || 0;
const totalSuccess = staticData.totalSuccess || 0;
const totalSkipped = staticData.totalSkipped || 0;
const totalFailed = staticData.totalFailed || 0;
const failedProducts = staticData.failedProductIds || [];
const batchNumber = staticData.batchNumber || 0;

let summaryLines = [
  '========================================',
  '  RESUME FINAL - One-Shot Shopify Update',
  '========================================',
  '',
  'Batches (pages) traites: ' + batchNumber,
  'Total produits scannes: ' + totalProcessed,
  '',
  '--- Resultats ---',
  'Succes (occasions ajoutees): ' + totalSuccess,
  'Ignores (filtres ou deja remplis): ' + totalSkipped,
  'Echecs: ' + totalFailed,
  ''
];

if (failedProducts.length > 0) {
  summaryLines.push('--- Produits en echec ---');
  failedProducts.forEach((fp, i) => {
    summaryLines.push((i + 1) + '. ID: ' + fp.productId + ' | ' + fp.title);
    summaryLines.push('   Erreur: ' + fp.error);
    summaryLines.push('   Occasions tentees: ' + JSON.stringify(fp.occasions));
  });
  summaryLines.push('');
}

summaryLines.push('========================================');
summaryLines.push('  Traitement termine.');
summaryLines.push('========================================');

const summary = summaryLines.join('\n');

return [{
  json: {
    summary: summary,
    stats: {
      batchesProcessed: batchNumber,
      totalScanned: totalProcessed,
      totalSuccess: totalSuccess,
      totalSkipped: totalSkipped,
      totalFailed: totalFailed,
      failedProducts: failedProducts
    }
  }
}];
